import React from "react";
import { Card as RsCard } from "reactstrap";

function Card({ titletext, subtext, text }) {
    return <div>
        <RsCard
            style={{
                width: '18rem'
            }}
        >
            <img
                alt="Sample"
                src="https://picsum.photos/300/200"
            />
            <CardBody>
                <CardTitle tag="h5">
                    {titletext}
                </CardTitle>
                <CardSubtitle
                    className="mb-2 text-muted"
                    tag="h6"
                >
                    {subtext}
                </CardSubtitle>
                <CardText>
                    {text}
                </CardText>
                <Button>
                    Button
                </Button>
            </CardBody>


        </RsCard>
    </div>
}
export { Card }
